define(function(c){var a=c("./quantile");var b=c("echarts").number;return function(e,g){g=g||[];var u=[];var v=[];var q=[];var h=g.boundIQR;for(var n=0;n<e.length;n++){q.push(n+"");var k=b.asc(e[n].slice());var t=a(k,0.25);var r=a(k,0.5);var p=a(k,0.75);var f=p-t;var s=h==="none"?k[0]:t-(h==null?1.5:h)*f;var l=h==="none"?k[k.length-1]:p+(h==null?1.5:h)*f;u.push([s,t,r,p,l]);for(var m=0;m<k.length;m++){var d=k[m];if(d<s||d>l){var o=[n,d];g.layout==="vertical"&&o.reverse();v.push(o)}}}return{boxData:u,outliers:v,axisData:q}}});